"MSG_CREDIT_EXPIRATION_RESET_SUBJECT" => "PamFax konto taasaktiveeritud",
"MSG_CREDIT_EXPIRATION_WARNING" => "Te ei ole faksi saatnud viimased {inactivity}päeva. Teie PamFax konto kaotab aktiivsuse pärast 180 päevast mittekasutamist. (See juhtub {days_to_expiration} päeva pärast)\n\nKuidas hoida oma plaani aktiivsena? See on lihtne. Faksi dokument või tiitelleht\n(kehtivale või kehtetule numbrile) või osta PamFax Krediidipakk või plaan meie poest {shop_url}",
"MSG_CREDIT_EXPIRATION_WARNING_1" => "Te ei ole tükil ajal oma PamFax krediiti kasutanud. Konto kaotab aktiivsuse kui teda ei ole 180 päeva järjest kastutatud. Teil on {days_to_expiration} päeva kuni konto kaotab aktiivsuse.\n\nKuidas hoida oma plaani aktiivsena? See on lihtne. Kasutage ühte alljärgnevat meetodit, et hoida konto aktiivne järgnevad 180 päeva:\n\n-Faksi dokument või tiitelleht (kehtivale või kehtetule numbrile)\n-osta PamFax Krediidipakk või plaan meie poest {shop_url}",
"MSG_CREDIT_EXPIRATION_WARNING_2" => "Te ei ole oma PamFax krediiti kasutanud üsna kaua. 180 päeva möödumisel kaotab krediit aktiivse staatuse. Teie krediit kaotab aktiivse staatuse {days_to_expiration} päeva pärast. \n\nKuidas hoida oma bilans aktiivsena? See on lihtne. Kasutage ükskõik millist allolevat meetodit ja Teie PamFax krediit on aktiivne järgmised 180 päeva:\n\n-Faksige dokument või tiitelleht (kehtivale või kehtetule numbrile)\n-ostke PamFax Pakk või Plaan meie poest \n{shop_url}",
"MSG_CREDIT_EXPIRATION_WARNING_3" => "Te ei ole oma PamFax krediiti kasutanud üsna kaua. 180 päeva möödumisel kaotab krediit aktiivse staatuse. Teie krediit kaotab aktiivse staatuse  48 tunni pärast. \n\nKuidas hoida oma bilans aktiivsena? See on lihtne. Kasutage ükskõik millist allolevat meetodit ja Teie PamFax krediit on aktiivne järgmised 180 päeva:\n\n-Faksige dokument või tiitelleht (kehtivale või kehtetule numbrile)\n-ostke PamFax Pakk või Plaan meie poest \n{shop_url}",
"MSG_CREDIT_EXPIRATION_WARNING_EMAIL_1" => "Te ei ole oma PamFax krediiti kasutanud üsna kaua. 180 päeva möödumisel kaotab krediit aktiivse staatuse. Teie krediit kaotab aktiivse staatuse  <b>{days_to_expiration} päeva </b>pärast. \n\nKuidas hoida oma bilans aktiivsena? See on lihtne. Kasutage ükskõik millist allolevat meetodit ja Teie PamFax krediit on aktiivne järgmised 180 päeva:\n\n-Faksige dokument või tiitelleht (kehtivale või kehtetule numbrile)\n-ostke PamFax Pakk või Plaan meie poest \n{shop_url}",
"MSG_CREDIT_EXPIRATION_WARNING_EMAIL_2" => "Te ei ole oma PamFax krediiti kasutanud üsna kaua. 180 päeva möödumisel kaotab krediit aktiivse staatuse. Teie krediit kaotab aktiivse staatuse  <b>{days_to_expiration} päeva </b>pärast. \n\nKuidas hoida oma bilans aktiivsena? See on lihtne. Kasutage ükskõik millist allolevat meetodit ja Teie PamFax krediit on aktiivne järgmised 180 päeva:\n\n-Faksige dokument või tiitelleht (kehtivale või kehtetule numbrile)\n-ostke PamFax Pakk või Plaan meie poest \n{shop_url}",
"MSG_CREDIT_EXPIRATION_WARNING_EMAIL_3" => "Te ei ole oma PamFax krediiti kasutanud üsna kaua. 180 päeva möödumisel kaotab krediit aktiivse staatuse. Teie krediit kaotab aktiivse staatuse  48 tunni pärast. \n\nKuidas hoida oma bilans aktiivsena? See on lihtne. Kasutage ükskõik millist allolevat meetodit ja Teie PamFax krediit on aktiivne järgmised 180 päeva:\n\n-Faksige dokument või tiitelleht (kehtivale või kehtetule numbrile)\n-ostke PamFax Pakk või Plaan meie poest \n{shop_url}",
"MSG_CREDIT_EXPIRATION_WARNING_MAIL_BODY" => "Te ei ole oma PamFax krediiti kasutanud üsna kaua. 180 päeva möödumisel kaotab krediit aktiivse staatuse. Teie krediit kaotab aktiivse staatuse  <b>{days_to_expiration} päeva </b>pärast. \n\nTeie konto info:\n\nPamFax Nimi: {username}\nBilans: {credit}\n\n\nKuidas hoida oma bilans aktiivsena? \n\nSee on lihtne. Kasutage ükskõik millist allolevat meetodit ja Teie PamFax krediit on aktiivne järgmised 180 päeva:\n\n-Faksige dokument või tiitelleht (kehtivale või kehtetule numbrile)\n-ostke PamFax Pakk või Plaan meie poest \n{shop_url}\n\n{email_footer}\n\n<p style='font-family: verdana, arial, helvetica, sans-serif; font-size: 10pt'>\n<i>Getting help for PamFax</i>\nPalun ärge vastake sellele emailile, soovikorral saate meiega ühendust:\n {website_url}support\n\n<i>Kaitse oma salasõna</i>\nPamConsult GmbH töötajad ei küsi Teie salasõna MITTE KUNAGI emaili teel. Ainsad korrad kui Teie salasõna küsitakse on oma kontole sisenemiseks või kui soovite PamFax leheküljelt sooritada mõnd ostu või tehingut. PamFax leheküljele sisenete alati turvalises keskonnas, me palume, et kontrolliksite,m et aadress Teie brauseris algab täpselt nii:{portal_url}. Veel peaks näha olema ka väike tabaluku sümbol, kinnitamaks ühenduse turvalisust.",
"MSG_CREDIT_EXPIRATION_WARNING_MAIL_SUBJ" => "Teie PamFax Krediiti kaotab varsti oma aktiivsuse",
