"MSG_PLAN_EXPIRATION_WARNING_1" => "Teie faksi {number}aegub {days_to_expiration} päeva jooksul ( {expiration_date}). \n\nEt pikendada oma PamFaxi (ning säilitada faksi number), tehke nii:\n\n1. Minge PamFax Poodi: {shop_url_plans}\n2. Sisenege oma PamFax kasutajanimega {username}\n3. Lõpetage makse. Pärast makse edukat sooritamist on Teie number pikendatud.\n\nTeie number ({number}) on siis kasutatav järgmised 3 või 12 kuud, kaasaarvatud piiramatu fakside vastuvõtt.\n\nNB: See ei mõjuta teie kontol olevat PamFax krediiti või Teie võimet saata fakse. Plaan on eraldi tellimus ja ei ole seotud Teie PamFax krediidiga.",
"MSG_PLAN_EXPIRATION_WARNING_2" => "Teie faksinumber {number} aegub {days_to_expiration} päeva pärast (sel kuupäeval{expiration_date}). \n\nEt pikendada oma PamFax Plaani (ja hoida alles number), järgige neid lihtsaid samme:\n\n1. Minge PamFax poodi: {shop_url_plans}\n2. Sisenege kasutades oma kasutajanime {username}\n3. Lõpeta makse. Peale edukat makset on Teie Plaan pikendatud.\n\nTeie number ({number}) on siis kasutatav järgmised 3 või 12 kuud, seal hulgas piiramatu fakside vastuvõtmine.\n\nNB: See ei mõjuta Teie PamFax krediiti või Teie võimet saata fakse. See Plaan on eraldi tellimus ja ei ole seotud Teie konto ja PamFax krediidiga.",
"MSG_PLAN_EXPIRATION_WARNING_3" => "Teie faksinumber {number} aegub 48 tunni pärast. See on viimane meiepoolne meeldetuletus!\n\nEt pikendada oma PamFax Plaani (ja hoida alles number), järgige neid lihtsaid samme:\n\n1. Minge PamFax poodi: {shop_url_plans}\n2. Sisenege kasutades oma kasutajanime {username}\n3. Lõpeta makse. Peale edukat makset on Teie Plaan pikendatud.\n\nTeie number  {number} on siis kasutatav järgmised 3 või 12 kuud, seal hulgas piiramatu fakside vastuvõtmine.\n\nKui Te 48 tunni jooksul oma numbrit ({number}) ei pikenda kustutatakse see jäädavalt\n\nNB: See ei mõjuta Teie PamFax krediiti või Teie võimet saata fakse. See Plaan on eraldi tellimus ja ei ole seotud Teie konto ja PamFax krediidiga.",
"MSG_PLAN_EXPIRATION_WARNING_EMAIL_1" => "Teie PamFax Plaan koos numbriga<b>{number}</b> aegub<b>päeva{days_to_expiration} pärast</b> (sel kp. {expiration_date})\n\nEt pikendada oma PamFax Plaani (ja hoida alles number), järgige neid lihtsaid samme:\n\n1. Minge PamFax poodi: {shop_url_plans}\n2. Sisenege kasutades oma kasutajanime {username}\n3. Lõpeta makse. Peale edukat makset on Teie Plaan pikendatud.\n\nTeie number  {number} on siis kasutatav järgmised 3 või 12 kuud, seal hulgas piiramatu fakside vastuvõtmine.\n\nMe tuletame seda Teile meelde veel 7 päeva enne aegumistähtaega.\n\nNB: See ei mõjuta Teie PamFax krediiti või Teie võimet saata fakse. See Plaan on eraldi tellimus ja ei ole seotud Teie konto ja PamFax krediidiga.",
