"MSG_PLAN_EXPIRATION_WARNING_EMAIL_3" => "Teie PamFax Plaan ja number <b>{number}</b> aeguvad<b>48 tunni jooksul</b>. See on <b>viimane email</b> mille me Teile saadame!\n\nEt pikendada oma PamFax Plaani (ja hoida alles number), järgige neid lihtsaid samme:\n\n1. Minge PamFax poodi: {shop_url_plans}\n2. Sisenege kasutades oma kasutajanime {username}\n3. Lõpeta makse. Peale edukat makset on Teie Plaan pikendatud.\n\nTeie number  {number} on siis kasutatav järgmised 3 või 12 kuud, seal hulgas piiramatu fakside vastuvõtmine.\n\nKui Te 48 tunni jooksul midagi ette ei võta, kustutatakse Teie<b>isiklik faksi number {number} jäädavalt</b>.\n\nNB: See ei mõjuta Teie PamFax krediiti või Teie võimet saata fakse. See Plaan on eraldi tellimus ja ei ole seotud Teie konto ja PamFax krediidiga.",
