"MSG_WELCOME_FAX" => "Tere,\n<br><br>\n Täname, et seadistasite PamFaxi. \n Saatsime Teile selle esimese faksi selleks, et näeksite, et Teie faksinumber on töökorras. Olete nüüd valmis saatma ja vastuvõtma fakse PamFaxiga.\nKas teadsite, et PamFax pakub Teile järgnevaid soodustusi? \n<ol>\n<li>Saadaval Windows, Macintosh, Linux, Android ja iPhone</li>\n<li>Lihtne saata fakse Outlook 2007/2010 kaasa arvatud PamFax Windows</li>\n<li>Ava Dropbox, Google Drive, OneDrive ja Box</li>\n<li>Saada fakse ülemaailma heade hindadega</li>\n<li>Maksa kasutades KrediidiPakke</li>\n<li>Teie PamFax krediit ei aegu kunagi</li>\n<li>Kogu informatsioon on krüpteeritud. Teie dokumendid on kaitstud</li>\n</ol><br>\nKui Te ei ole veel lisanud om aPamFax kontole krediiti saate seda lihtsalt teha PamFax aplikatsiooni kaudu. Avage PamFax, klikake \"Osta PamFax Krediiti\", valige summa ja liikuge väljumise poole. Maksta on võimalik kõigi suuremate krediitkaartidega.\n Teenige lisa tasuta lehekülgi soovitades PamFaxi oma sõpradele. Iga sõbra eest kes liitub, lisa meie automaatselt ühe tasuta lehekülje Teie kontole. Soovitamise funktsiooni leiate PamFax leheküljelt peale faksi saatmist või PamFax portaalist. Mida rohkem Te soovitate seda rohkem tasuta lehekülgi saate!\nMe loodame, et Teile meeldib meie teenus. Kui Teil on küsimusi võtke meiega kindlasti ühendust läbi meie klienditeeninduse PamFax koduleheküljel",
